import React, { useState } from "react";

import Menu from "./menu.js";
import List from "./list.js";
import NewItemPopup from "./newitempopup.js";

const BOOLEAN = { true: "true", false: "false" };

function Content({ setCurrentScreen }) {
  const [popupShown, setPopupShown] = useState[BOOLEAN.false];

  switch (popupShown) {
    case BOOLEAN.true:
      return (
        <div className="content">
          <Menu setCurrentScreen={setCurrentScreen} />
          <List />
          <NewItemPopup setPopupShown={setPopupShown} />
        </div>
      );
    case BOOLEAN.false:
      return (
        <div className="content">
          <Menu setCurrentScreen={setCurrentScreen} />
          <List />
        </div>
      );
  }
}

export default Content;
